import logo from './logo.svg';
import './App.css';
import './TaskItem';
import './DataContainer';
import {useState} from "react";
import AppHeader from "./AppHeader";
import TaskList from "./TaskList";


function App(props) {


  return (
      <div>
          <AppHeader/>
          <TaskList data={props.data} handleChange={props.handleChange}/>
          <button className="plus-button" type="button" id="plus" onClick = {props.handlePlusClick}> + </button>
          <label htmlFor="plus" className="newItem"> Create new item </label>
          <button className="uncompleted" type="button" id="showUncom"> Show only uncompleted items</button>
          <button className="deleteCompleted" type="button" id="delete"> Delete completed items</button>
      </div>

  );
}

export default App;
